import React, { useState } from 'react';

const Form = () => {
  const [preset, setPreset] = useState([]);

  preset = {
    reverb: '',
    delay: '',
    tremolo: '',
    waveshape: '',
    envelope: '',
  };

  return (
    <div>
      <h3>Create Synthesizer Preset</h3>
      <form>
        <div>
          <label htmlFor="reverb">Reverb</label>
          <input type="text" id="reverb" />
        </div>
        <div>
          <label htmlFor="delay">Delay</label>
          <input type="text" id="delay" />
        </div>
        <div>
          <label htmlFor="tremolo">Tremolo</label>
          <input type="text" id="tremolo" />
        </div>
        <div>
          <label htmlFor="waveshape">Waveshape</label>
          <input type="text" id="waveshape" />
        </div>
        <div>
          <label htmlFor="envelope">Envelope</label>
          <input type="text" id="envelope" />
        </div>
        <input type="submit" value="Save Preset" />
      </form>
    </div>
  );
};

export default Form;
